import { QRCodeCanvas } from 'qrcode.react';

const QRDisplay = ({ qrValue }) => {
  return (
    <div>
      <h2>Scan this QR to mark attendance</h2>
      <QRCodeCanvas value={qrValue || "default-value"} size={256} />
    </div>
  );
};

export default QRDisplay;
